import { createRoot } from "react-dom/client";
import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
  BrowserRouter as Router,
  Switch,

} from "react-router-dom";

const App = () => {
  return (
    <Router>
      <Link to="/">Home</Link>
      <Link to="/">About</Link>

      <Switch>
        <Route path="/" exact>
          <Home />
        </Route>
        <Route path="/about" exact>
          <About />
        </Route>
      </Switch>
    </Router>
    // <Container />
  );
}

export default App;
